import './App.css';
import {Container, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Helper from './Components/Helper';


function App() {
  return (
    <Container>
      <Col lg = "4" md = "6" sm = "12"><Helper /></Col>   
    </Container>
  );
}

export default App;
